import React, {Component} from 'react';

class ocompannyy extends Component {
    render() {
        return (
            <div>
                <h2>О Компании</h2>
                <p>
                <b>MarketDo4a</b> существует с 2014 года. <br/>
            В наших магазинах представлен огромный ассортимент, где вы сможете купить все необходимые атлетические продукты,<br/>
             а также одежду и аксессуары для тренировок. Мы всегда рады помочь Вам с подбором необходимых добавок. 
                </p>
            </div>
        );
    }
}

export default ocompannyy;
